import React, {Component} from 'react';

class Results extends Component {
	constructor(props) {
		super();

		this.movie = new URLSearchParams(props.location.search).get('infoShow');
	}

	render() {
		return (
			<center>
				This movie has {this.infoShow};
			</center>
			);
		}
	}

export default darkKnight;
